import * as React from 'react';
import Button from '@mui/material/Button';



export default function LogBar() {



    return (
        <div>
            <Button href="/login" variant="outlined" sx={{my: 1, mx: 1.5}}>
                Login
            </Button>
            <Button href="/register" variant="outlined" sx={{my: 1, mx: 1.5}}>
                Register
            </Button>
        </div>
    )
}
